import React from "react";
import ContentsTable from "Components/ContentsTable";
import SubChapter from "Components/SubChapter";
import Paragraph from "Components/Paragraph";
import SubTitle from "Components/SubTitle";
import ImagePlus from "Components/ImagePlus";
import ChapterLayout from "Layouts/ChapterLayout";
import ReferencesBlock from "Components/ReferencesBlock";
import bienestar from "Media/images/bienestar.jpeg"

const Referencias = () => {
    return (
      <ChapterLayout
        chapter_title="Referencias"
        chapter_image={bienestar}>
             <section id = "referencias" className = "container bg-light">
            <ReferencesBlock 
            references = {[<a href="https://www.statista.com/statistics-glossary/definition/351/raw_data/"><u>Defición de Datos Crudos</u>. Enciclopedia Statista. Consultado en Mayo 2021 </a>,
            <a href="https://www.sisense.com/blog/understanding-structured-and-unstructured-data/"><u>Entendiendo la data estructurada y desestructurada. </u>De Couto Carmen, 2020 en Sisense.com.  Consultado Mayo 2021</a>,
            <a href="https://www.questionpro.com/blog/nominal-ordinal-interval-ratio/"><u>Niveles de Medición </u>en questionpro.com. Consultado Mayo 2021 </a>,<a href="https://www.oracle.com/ca-en/data-science/what-is-data-science.html"> <u>Qué es la Ciencia de los Datos?</u> Oracle. Consultado en Mayo 2021.</a>,
            <a href="https://ischoolonline.berkeley.edu/data-science/what-is-data-science/"><u>Qué es la Ciencia de los Datos?</u> Berkeley School of Information.  Consultado en Mayo 2021.</a>,<a href="https://www.displayr.com/what-is-raw-data/"><u>Qué son los Datos Crudos? </u> Bock Tim, 2018 en displayr.com </a>

            ]}
            />

       </section>

        </ChapterLayout>

    );};
    export default Referencias
